import React from "react";
import { Routes, Route, NavLink, Navigate } from "react-router-dom";

import CourseContainer from "./courses/CourseContainer";

import { HTMLCourses } from "../data/courses";

const Courses = ({ match }) => (
  <div className="main-content courses">
    <div className="course-header group">
      <h2>Courses</h2>
      <ul className="course-nav">
        <li>
          <NavLink to="html">HTML</NavLink>
        </li>
        <li>
          <NavLink to="css">CSS</NavLink>
        </li>
        <li>
          <NavLink to="javascript">JavaScript</NavLink>
        </li>
      </ul>
    </div>
    {/* Write routes here... */}
    {console.log(match)}
    <Routes>
      <Route path="" element={<Navigate replace to="/courses/html" />} />
      <Route path="html" element={<CourseContainer />} />
      <Route path="css" element={<CourseContainer />} />
      <Route path="javascript" element={<CourseContainer />} />
    </Routes>
  </div>
);

export default Courses;
